And it’s a wrap! @ChristoJeanneClaude finally wrapped up the Arc de Triomphe in Paris, the last project of the artist initiated before his death. A temporary work of art on view for 16 days, from Saturday, September 18 to Sunday, October 3, 2021. 

@Christojeanneclaude a emballé l’Arc de Triomphe à Paris, le dernier projet de l’artiste initié avant sa mort. Une oeuvre d’art temporaire installée pour 16 jours jusqu’au 3 Octobre.

